// import { data } from 'autoprefixer'
import React from 'react'
import useProducts from './data/useProducts'

export default function App() {
  const products = useProducts()
  if (products !== null) {
    return (
        <ul>
          {
            products.map(product => (
              <li key={product.id}>{product.name}</li>
            ))
          }
        </ul>
    )
  }
}
